import { Link } from "react-router-dom";
function Chooser() {
    return (
        <div className="App">
        <header className="App-header">
            <h3>Hello from Chooser</h3>
        </header>
        <button><Link to = "/cheecker">Go to Cheecker</Link></button>
        </div>
    );
}

export default Chooser;
